        private string DoLengthOfLongestSubstring(string s)
        {
            if (s.Length == 0 || s.Length == 1)
            {
                return s;
            }

            var subString = string.Empty;

            for (int i = 1; i <= s.Length; i++)
            {
                for (int j = 0; j < s.Length; j++)
                {
                    if (i + j > s.Length)
                    {
                        break;
                    }

                    var a = s.Substring(j, i);

                    if (CheckUnique(a))
                    {
                        subString = a;
                    }
                }
            }

            return subString;
        }

        public int DlengthOfLongestSubstring(string s)
        {
            int n = s.Length;
            var set = new HashSet<char>();
            int ans = 0, i = 0, j = 0;
            var list = new List<char>();

            while (i < n && j < n)
            {
                // try to extend the range [i, j]
                if (!set.Contains(s[j]))
                {
                    set.Add(s[j]);
                    j++;
                    ans = Math.Max(ans, j - i);
                }
                else
                {
                    set.Remove(s[i]);
                    i++;
                }
            }

            return ans;
        }

        private bool CheckUnique(string s)
        {
            if (s.Length == 1)
            {
                return true;
            }

            var chars = s.ToCharArray();
            var set = new HashSet<char>();
            for (int i = 0; i < chars.Length; i++)
            {
                if (set.Contains(chars[i]))
                {
                    return false;
                }

                set.Add(chars[i]);
            }

            return true;
        }
